      longitudeEnd = longitudeEnd * Math.PI / 180;
      latitudeStart = latitudeStart * Math.PI / 180;
      latitudeEnd = latitudeEnd * Math.PI / 180;

      // Haversine formula
      var dlon = longitudeEnd - longitudeStart;
